//              COMPONENT FOR PROFILE CARD                  //

    // Importing Require Module :
import React from 'react';


    // Profile Card Component :
        // This Function have a Parameter to that contain the Specific data from Specific Element , 
            // & Insert this Data for that Element , The data is comming as a Costum Attributes from the Respective Element.
function Pro(data) {

    // Returning the JSX :
    return (
        <>
            <div id="ProfileCard">
                <div id="ProfileImg">
                    <img src={data.proimg} alt="ERROR"></img>
                </div>
                <div id="ProfileContent">
                    <strong>NAME : </strong> <span>{data.proname}</span> <br />
                    <strong>PROFESSION : </strong> <span>Software Developer</span>
                    <button href={data.prolink}>Profile</button>

                </div>
            </div>
        </>
    )
};

    // Exporting the Component :
export default Pro;
